        _admin = msg.sender;        
    }
	
    function setTeamSize(uint256 size) external onlyOwner{
		teamSize = size;
	}
    function setjoinPVPprice(uint256 price) external onlyOwner{
		joinPVPprice = price;
	}
    function setjoinPVPTokenPrice(uint256 price) external onlyOwner{
		joinPVPTokenPrice = price;
	}
    
    function increaseStats(uint256 id, uint256 attack, uint256 health, uint256 critical) external {
        require(AvaxFoxesContract.ownerOf(id) == msg.sender, "AvaxFoxes: You can only increase stats of your own Avax Fox");
        require(attack!=0 || health!=0 || critical!=0, "AvaxFoxes: All stats are given 0");
        uint256 requiredToken = 0;
        for(uint256 i = 0; i<attack; i++){
            requiredToken += Attack[id]+i+1;
        }
        for(uint256 i = 0; i<health; i++){
            requiredToken += Health[id]+i+1;
        }
        for(uint256 i = 0; i<critical; i++){
            requiredToken += Critical[id]+i+1;
        }
        require(balanceOf(msg.sender) >= requiredToken*1000000000000000000, "AvaxFoxes: you dont have enough tokens");
        _burn(msg.sender, requiredToken*1000000000000000000);
        Attack[id]+=attack;
        Health[id]+=health;
        Critical[id]+=critical;
    }

    function PVPfight() private {
        uint256 totalAttack_1 = 0;
        uint256 totalHealth_1 = 0;        
        uint256 totalCritical_1 = 0;
        uint256 totalAttack_2 = 0;
        uint256 totalHealth_2 = 0;        
        uint256 totalCritical_2 = 0;
        
        for(uint playerNo = 0; playerNo < teamSize; playerNo++){
            totalAttack_1 += Attack[team1ids[playerNo]];
            totalHealth_1 += Health[team1ids[playerNo]];
            totalCritical_1 += Critical[team1ids[playerNo]];

            totalAttack_2 += Attack[team2ids[playerNo]];
            totalHealth_2 += Health[team2ids[playerNo]];
            totalCritical_2 += Critical[team2ids[playerNo]];
        }
        
        if(totalAttack_1>=totalAttack_2){
            for (uint i = 0; i < teamSize; i++){
                payable(team1[i]).transfer(joinPVPprice.mul(2));
                _mint(team1[i], joinPVPTokenPrice);
            }
        }
        else{
            for (uint i = 0; i < teamSize; i++){
                payable(team2[i]).transfer(joinPVPprice.mul(2));
                _mint(team2[i], joinPVPTokenPrice);
            }
        }        
        
        team1 = new address[](teamSize);
        team2 = new address[](teamSize);
        team1ids = new uint256[](teamSize);
        team2ids = new uint256[](teamSize);        
    }
    function canJoinPVP(address _user , uint256 id) public view returns(bool) {
       bool state=true;
       if(SafeMath.sub(block.timestamp, lastBattle[id])<86400){
           state=false;
       }
       for (uint i = 0; i < teamSize; i++) {
            if(team1[i]==_user || team2[i]==_user){
                state=false;
            }            
        } 

       return state;
	}

    function joinPVP(uint256 id) external payable{
        require(joinPVPprice == msg.value, "AvaxFoxes: invalid ether value");
        require(balanceOf(msg.sender) > joinPVPTokenPrice, "AvaxFoxes: you dont have enough tokens");
        require(AvaxFoxesContract.ownerOf(id) == msg.sender, "AvaxFoxes: You can only join with your own Avax Fox");
        /*
        for (uint i = 0; i < teamSize; i++) {
            require(team1[i]!=msg.sender, "AvaxFoxes: You already joined this battle");
            require(team2[i]!=msg.sender, "AvaxFoxes: You already joined this battle");
        }
        if(lastBattle[id]>0){
            require(SafeMath.sub(block.timestamp, lastBattle[id])>86400, "This Avax Fox battled soon and it is still tired");
        }else{
            lastBattle[id]=block.timestamp;
        }*/
        require(canJoinPVP(msg.sender, id), "Avax Foxes: You cant join pvp");
        _burn(msg.sender, joinPVPTokenPrice);
        for (uint i = 0; i < teamSize; i++) {
            if(team1[i]==address(0)){
                team1[i]=msg.sender;
                team1ids[i]=id;
                break;
            }
            if(team2[i]==address(0)){
                team2[i]=msg.sender;
                team2ids[i]=id;
                break;
            }
        }
        if(team2[teamSize-1]!=address(0)){
            PVPfight();
        }
        
    }   

	function min(uint256 a, uint256 b) internal pure returns (uint256) {
		return a < b ? a : b;
	}
    function max(uint256 a, uint256 b) internal pure returns (uint256) {
		return a < b ? b : a;
	}
    function getTotalClaimable(address _user) public view returns(uint256) {
       uint256[] memory ids = AvaxFoxesContract.walletOfOwner(_user);
       uint256 pending = 0;
       uint256 time = min(block.timestamp, END);
       for (uint i = 0; i < ids.length; i++){
           pending += BASE_RATE.mul(time.sub(max(lastUpdate[ids[i]],START))).div(86400);
       }
       return pending;
	}
    function setClaimed(address _user) private {
       uint256[] memory ids = AvaxFoxesContract.walletOfOwner(_user);       
       uint256 time = min(block.timestamp, END);
       for (uint i = 0; i < ids.length; i++){
           lastUpdate[ids[i]] = time;
       }      
	}

	function getReward() public {
		uint count = getTotalClaimable(msg.sender);
        setClaimed(msg.sender);
		_mint(msg.sender, count);
	}

	function burn(address _from, uint256 _amount) external {
		require(msg.sender == _from || msg.sender == _admin);
		_burn(_from, _amount);
	}

	
}

